import { MDBDataTableV5 } from "mdbreact";

export default function TopSearch({ people }) {
  const [datatable, setDatatable] = React.useState({
    columns: [
      {
        label: "Image",
        field: "image",
        width: 150,
        attributes: {
          "aria-controls": "DataTable",
          "aria-label": "Image"
        }
      },
      {
        label: "Name",
        field: "name",
        width: 270
      },
      {
        label: "Title",
        field: "title",
        width: 200
      },
      {
        label: "Email",
        field: "email",
        sort: "asc",
        width: 100
      },
      {
        label: "Contact",
        field: "contact",
        sort: "disabled",
        width: 150
      }
    ],
    rows: people
  });

  return (
    <MDBDataTableV5
      hover
      entriesOptions={[5, 10, 15, 20, 25, 30]}
      entries={10}
      pagesAmount={4}
      data={datatable}
      fullPagination
      searchTop
      searchBottom={false}
    />
  );
}
